import { useState } from "react";
import useAuth from "../../hooks/useAuth";
import { useNavigate } from 'react-router-dom';
import api from "../../services/api";
import { Container, Header, Button, Historic } from "../../components/TransactionsComponents";
import Footer from "../../components/TransactionsComponents/Footer";

export default function Transactions() {
  const navigate = useNavigate();
  const { auth } = useAuth();



  return (
    <Container>
      <Header>
        Olá, {auth.name}
        <ion-icon name="exit-outline"></ion-icon>
      </Header>
      <Historic>
      oi
      </Historic>

      <Footer>
        <Button>
          <div><ion-icon name="add-circle-outline"></ion-icon></div>
          <div>Nova<br/>
            Entrada
            </div>
        </Button>
        <Button>
          <div><ion-icon name="remove-circle-outline"></ion-icon></div>
          <div>Nova<br/>
            Saída</div>
        </Button>
      </Footer>
    </Container>
  );
}
